import React, { Component } from 'react'
import NewsItem from './NewsItem'

export default class extends Component {
  articles=[]
  constructor() {
    super();
    this.state = {
      //here inside the state; paste the example response code copied from newsapi
      "status": "ok",
      "totalResults": 10,
      "articles": [xx
      ]
    }
  }
  render() {
    return (
      <div className="container my3">
        <h2>Top HeadLines</h2>
        <div className="row">
          <div className="colmd4 my3">
            <NewsItem title="International" description="Covid 6th wave started in China" imgurl="https://images.pexels.com/photos/3769138/pexelsphoto3769138.jpeg?auto=compress&cs=tinysrgb&w=600" />
          </div>
          <div className="colmd4 my3">
            <NewsItem title="Local News" description="Covid 6th wave started in China" imgurl="https://images.pexels.com/photos/4588567/pexelsphoto4588567.jpeg?auto=compress&cs=tinysrgb&w=600" />
          </div>
          <div className="colmd4 my3">
            <NewsItem title="Cricket" description="Covid 6th wave started in China" imgurl="https://images.pexels.com/photos/3800517/pexelsphoto3800517.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" />
          </div>
          <div className="colmd4 my3">
            <NewsItem title="Politics" description="Covid 6th wave started in China" />
          </div>
          <div className="colmd4 my3">
            <NewsItem title="Health" description="Covid 6th wave started in China" />
          </div>
          <div className="colmd4 my3">
            <NewsItem title="Astrology" description="Covid 6th wave started in China" />
          </div>
        </div>
      </div>
    )
  }
}
